import { Container, Row, Col, Button, Card } from "react-bootstrap";
function Footer() {
  return (
    <div>
      <Container>
        <center>
          <Row>
            <Col
              xs={12}
              md={3}
              style={{
                height: "40vh",
              }}
            >
              <label style={{ float: "left", color: "#737373" }}>
                OUR STORY
              </label>
              <br />
              <br />
              <br />
              <label
                style={{ float: "left", fontSize: "14px", color: "#b1b1b1" }}
              >
                Lorem ipsum dolor sit amet, consectetr
              </label>
              <br />
              <label
                style={{ float: "left", fontSize: "14px", color: "#b1b1b1" }}
              >
                adipiscing elit, sed do eiusmod tempor
              </label>
              <br />
              <label
                style={{ float: "left", fontSize: "14px", color: "#b1b1b1" }}
              >
                incididunt ut labore et dolore magna aliqua
              </label>
              <br />
              <br />
              <img
                style={{ float: "left", marginRight: "20px" }}
                src="./assets/icons/facebook.svg"
              />
              <img
                style={{ float: "left", marginRight: "20px" }}
                src="./assets/icons/twitter.svg"
              />
              <img
                style={{ float: "left", marginRight: "20px" }}
                src="./assets/icons/instagram.svg"
              />
              <br />
              <br />
              <br />
              <br />
              <div style={{ float: "left", color: "#b1b1b1" }}>
                &#169; 2020 BLAUCHE
              </div>
            </Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/10.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/11.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/12.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
          </Row>
        </center>
      </Container>
    </div>
  );
}
export default Footer;
